import { Auth } from 'aws-amplify';
import { marked } from 'marked';
import DOMPurify from 'dompurify';

import { type Config } from './models.ts';

import './chat.css';
import { AgentClient } from "./agentClient.ts";
import { ModelClient } from "./modelClient.ts";

export class AWSBRChat {
    // AWSConfig: AWSConfig;
    config: Config;
    messages: any[] = [];
    dom_messages: any;
    dom_loading: any;
    dom_submit: any;
    chatInterface: HTMLElement | undefined;
    loading: boolean = false;

    promptInputElement: HTMLInputElement | undefined;

    #bedrockClient: any;

    constructor(config: Config) {
        // this.AWSConfig = AWSconfig;
        this.config = config;

        try {
            this.checkConfigs();
        } catch (error) {
            console.log(error);
            return;
        }
        this.setup();

        this.init();
    }

    async init() {
        let credentials;
        try {
            if (this.config.auth.cognito) {
                credentials = await Auth.currentCredentials();
            } else {
                throw new Error("There is an error with your credentials. Check if you put a valid role");
            }
            if (this.config.bedrock.agent) {
                this.#bedrockClient = new AgentClient(this.config, credentials);
            } else if (this.config.bedrock.modelId) {
                this.#bedrockClient = new ModelClient(this.config, credentials);
            }
        } catch (error) {
            console.log(error);
        }

        if (this.config?.ui.webExperience) {
            this.buildWebExperience(this.config.ui.webExperience);
        }
    }

    setup() {
        if (this.config.ui.floatingWindow) {
            this.buildButton();
        }
        this.buildChatWindow();
    }

    checkConfigs() {
        if (this.config.ui.floatingWindow === true && this.config.ui.containerId !== undefined) {
            throw new Error("You can't have a containerId and floatingWindow to true");
        }
        if (this.config.bedrock.modelId  !== undefined && this.config.bedrock.agent !== undefined) {
            throw new Error("You can't specify a modelId and an agent");
        }
    }

    buildWebExperience(webExperience: any) {
        let tmpl = '';
        if (this.config.ui.floatingWindow) {
            tmpl = `<div class="webExperience whiteBackground">
                <div class="header">
                    <div class="title">${webExperience.title}</div>
                    <div class="subtitle">${webExperience.subtitle}</div>
                </div>
                <div class="welcomeMessage">
                    <div class="conversation-thread">
                        ${this.getMessageTemplate({
                            role: "assistant",
                            content: [{ text: webExperience.welcomeMessage }]
                        })}
                    </div>
                </div>
            </div>`;
        }
        else {
            tmpl = `<div class="webExperience">
                    <div class="welcomeMessage">
                        <div class="conversation-thread">
                            ${this.getMessageTemplate({
                                role: "assistant",
                                content: [{ text: webExperience.welcomeMessage }]
                            })}
                        </div>
                    </div>
                </div>`;
        }

        const range = document.createRange();
        const fragment = range.createContextualFragment(tmpl);

        if (this.messages.length === 0) {
            document.querySelector('#chatApp .message-list')?.appendChild(fragment);
        }
    }

    buildChatWindow() {
        let classNameAux = '';
        if (this.config.ui.floatingWindow) {
            classNameAux = 'whiteBackground';
        }
        const tmpl = `
        <div id="chatApp" class="chatApp">
            <div class="message-list ${classNameAux}">
            <div class="conversation-thread">
                <div id="messages">
                <div></div>
                </div>
            </div>
            </div>
            <div id="loader" class="text" *ngIf="loading">
                <div class="typing-animation">
                    <div class="typing-dot" style="--delay: 0.2s">•</div>
                    <div class="typing-dot" style="--delay: 0.3s">•</div>
                    <div class="typing-dot" style="--delay: 0.4s">•</div>
                    &nbsp;
                </div>
            </div>
            <div class="prompt-container">
            <div class="prompt-body">
                <div class="prompt">
                <form>
                    <textarea id="prompt" placeholder="How can I help you today?"></textarea>
                    <div class="button">
                    <button type="button" id="submit-button">
                        <img src="data:image/svg+xml;base64," alt="submit">
                    </button>
                    </div>
                </form>
                </div>
            </div>
            </div>
        </div>
      `;
        if (this.config.ui.floatingWindow) {
            this.chatInterface = document.createElement('div');
            this.chatInterface.style.display = 'none';
            this.chatInterface.className = "floating-chat";
            this.chatInterface.innerHTML = tmpl;
            document.body.appendChild(this.chatInterface);
        } else if (this.config.ui.containerId) {
            document.querySelector(`#${this.config.ui.containerId}`)!.innerHTML = tmpl;
        }

        this.dom_messages = document.querySelector('#chatApp #messages');
        this.dom_submit = document.querySelector('#chatApp #submit-button');
        this.dom_loading = document.querySelector('#chatApp #loader');
        this.promptInputElement = document.querySelector('#chatApp #prompt') as HTMLInputElement;
        this.promptInputElement.addEventListener("keyup", this.onInputKeyUp.bind(this));
        this.promptInputElement?.addEventListener("keydown", this.onInputKeyDown.bind(this));

        this.dom_submit?.addEventListener('click', this.submitMessage.bind(this));
    }

    async sendMessage(prompt: string, display: boolean = true) {
        this.setLoading(true);
        const message = {
            role: "user",
            content: [{ text: prompt }]
        };

        if (this.messages.length === 0 && this.config.ui.webExperience) {
            const dom_webExperience = (document.querySelector("#chatApp .webExperience") as HTMLInputElement | null)
            if (dom_webExperience) {
                dom_webExperience.style.display = "none";
            }
        }

        this.messages.push(message);

        if (this.promptInputElement) {
            this.promptInputElement.value = "";
        }

        if (display) {
            this.displayMessage(message);
        }

        try {
            const completion = await this.#bedrockClient.sendMessage(this.messages);

            const responseMessage = {
                role: "assistant",
                content: [{ text: completion }]
            }
            this.messages.push(responseMessage);

            if (display) {
                this.displayMessage(responseMessage);
            }
        } catch (err) {
            console.log(`ERROR: ${err}`);
        }

        this.setLoading(false);
    }

    getSourceTemplate(source: any) {
        if (source.url !== "") {
            return `
            <a class="title" href="${source.url}">${source.title}</a>
            <div class="description">
              ${source.url}
            </div>
            `;
        } else {
            return `
            <div class="title">${source.title}</div>
            `;
        };
    }

    getSources(message: any) {
        if (message.sourceAttribution && message.sourceAttribution.length > 0) {
            let tmpl = `
              <div class="label">Sources</div>
              <div class="source-list">`;
            for (const source of message.sourceAttribution) {
                tmpl += `
                <div class="source">
                  ${this.getSourceTemplate(source)}
                </div>
              `;
            }
            tmpl += '</div>';

            return tmpl;
        }
        return "";
    }

    getMessageAvatar(message: any) {
        if (message.role === "user") {
            return "data:image/svg+xml;base64,";
        } else if (message.role === "assistant") {
            return "data:image/svg+xml;base64,";
        }
        return "";
    }

    getMessageTemplate(message: any) {
        return `
        <div class="message ${message.role}">
            <img class="avatar" src="${this.getMessageAvatar(message)}"/>
            <div class="body-response">
              <div class="text">${DOMPurify.sanitize(marked.parse(message.content[0].text) as string)}</div>
            </div>
        </div>
        `;
    }

    generateMessageTemplate(message: any) {
        const tmpl = this.getMessageTemplate(message);
        const range = document.createRange();
        const fragment = range.createContextualFragment(tmpl);

        return fragment;
    }

    toggleChatWindow() {
        if (this.chatInterface?.style.display === 'none') {
            this.chatInterface!.style.display = 'block';
        } else {
            this.chatInterface!.style.display = 'none';
        }
    }

    displayMessage(message: any) {
        this.dom_messages.insertBefore(this.generateMessageTemplate(message), this.dom_messages.lastChild.nextSibling);
    }

    setLoading(loading: boolean) {
        this.loading = loading;
        if (loading) {
            this.dom_submit?.setAttribute("disabled", "disabled");
            this.dom_loading.style.display = "block";
        } else {
            this.dom_submit?.removeAttribute("disabled");
            this.dom_loading.style.display = "none";
        }
    }

    submitMessage() {
        if (this.loading) {
            return;
        }
        const prompt = (document.querySelector("#prompt") as HTMLInputElement | null)?.value;
        if (prompt === "" || prompt === undefined) {
            return;
        };
        this.sendMessage(prompt);
    }

    onInputKeyDown(e: any) {
        if (e.key === "Enter" && !e.shiftKey) {
            e.preventDefault();
            //   this.onSubmit();
            this.submitMessage();
        }
    }

    onInputKeyUp() {
        if (this.promptInputElement) {
            this.promptInputElement.style.height = "0px";
            this.promptInputElement.style.height = `${this.promptInputElement.scrollHeight}px`;
        }
    }

    buildButton() {
        let logoUrl = "data:image/png;base64,";
        if (this.config.ui.logoUrl) {
            logoUrl = this.config.ui.logoUrl
        }
        const chatButton = `
            <button id="chatButton">
                <img src="${logoUrl}" />
            </button>
        `;
        const buttonDiv = document.createElement('div');
        buttonDiv.innerHTML = chatButton;

        buttonDiv.addEventListener('click', () => {
            this.toggleChatWindow();
        });

        document.body.appendChild(buttonDiv);
    }
}